import Header from '../elements/Header';
import Aside from '../elements/Aside';
import Footer from '../elements/Footer';
import styles from './Layout.module.css';

const LayoutStyle = {
    margin: 20,
    padding: 20,
}

const Layout = (props) => {
    return (
        <div style={LayoutStyle}>
            <Header />
            <Aside />
            <main>
                { props.children }
            </main>
            <Footer />
        </div>
    );
}

export default Layout;
